import NProgress from 'nprogress';

Router.onRouteChangeStart = () => {
  NProgress.start();
};
const Layout = ({ children }) => {
  return (
    <div>
      <header></header>
      {children}
      <footer>&copy; {new Date().getFullYear()}</footer>
    </div>
  );
};
export default Layout;
